// ImageDisplay.js
import React from 'react';

const ImageDisplay = () => {
  // Ganti path dengan path gambar yang sesuai di penyimpanan lokal Anda
  const imagePath = 'file:///D:/AI Kamera/oil_filter/baru.jpg';

  return (
    <div>
      <h1>Gambar dari Disk D</h1>
      <img src={imagePath} alt="Gambar dari Disk D" />
    </div>
  );
};

export default ImageDisplay;
